import React from "react";
import "./Skills.css";

const Skills = () => {
  const skills = ["Android", "Bootstrap", "C++", "C#", "CSS3", "Github", "HTML5", "Java", "JavaScript", "MongoDB", "NodeJS", "React"];

  return (
    <section className="skillsContainer" id="skills">
      <h2>Skills & Abilities</h2>
      <ul className="skillsList">
        {skills.map((skill, index) => (
          <li key={index} className="skillItem">{skill}</li>
        ))}
      </ul>
    </section>
  );
};

export default Skills;
